const fs = require('fs')
const fetch = require('node-fetch')
const FormData = require('form-data')
const { fromBuffer } = require('file-type')
const axios = require('axios')
/**
 * Upload image to telegra.ph
 * Supported mimetype:
 * - `image/jpeg`
 * - `image/jpg`
 * - `image/png`s
 * @param {Buffer} buffer Image Buffer
 */


const getBuffer = async (url, options) => {
  try {
    options ? options : {};
    const res = await axios({
      method: "get",
      url,
      headers: {
        DNT: 1,
        "Upgrade-Insecure-Request": 1,
      },
      ...options,
      responseType: "arraybuffer",
    });
    return res.data;
  } catch (e) {
    console.log(`Error : ${e}`);
  }
}
const telegs = async(buffer) => {
if(!buffer) return new Error('Buffer/Url Not Found')
 if(buffer.includes('https')) buffer = await getBuffer(buffer)
  const { ext } = await fromBuffer(buffer)
  let form = new FormData
  form.append('file', buffer, 'tmp.' + ext)
  let res = await fetch('https://telegra.ph/upload', {
    method: 'POST',
    body: form
  })
  let img = await res.json()
  if (img.error) throw img.error
  return {url: 'https://telegra.ph' + img[0].src}
}
const teleg = async(buffer) => {
  const { ext } = await fromBuffer(buffer)
  let forms = new FormData
  forms.append('file', buffer, 'tmp.' + ext)
  let ress = await fetch('https://telegra.ph/upload', {
    method: 'POST',
    body: forms
  })
  let img = await ress.json()
  if (img.error) throw img.error
  return 'https://telegra.ph' + img[0].src
}
